# Comments from the below post
# https://leetcode.com/problems/max-consecutive-ones-iii/discuss/247564/JavaC%2B%2BPython-Sliding-Window
# In short:
# We are looking for bigger window size, when we find one, we use this window to iterate till we find a larger one(if any).
from typing import List
class Solution:
    def longestOnes(self, A: List[int], K: int) -> int:
        # For the reference
        # Solution from the above post:
        # i = 0
        # for j in range(len(A)):
        #     K -= 1 - A[j]
        #     if K < 0:
        #         K += 1 - A[i]
        #         i += 1
        # return j - i + 1

        res = 0
        i, j = 0, 0
        cnt = 0
        while j < len(A):
            if A[j] == 0:
                cnt += 1
            if cnt == K:
                res = max(res, j+1-i)
            if cnt > K:
                if A[i] == 0:
                    cnt -= 1
                    i += 1
                else:
                    while i < j and A[i] == 1:
                        i += 1
                    cnt -= 1
                    i += 1
            j += 1
        return res if cnt >= K else len(A)

solution = Solution()
print(solution.longestOnes(A, K))

